import React from 'react';
import {Panel, PanelGroup} from 'rsuite';
import 'rsuite/dist/styles/rsuite-default.css';

export type FaqVProps = {
  faqData?: any[];
  title?:any;
};

const faqData = [
  {
    heading:"FAQ"
  },
  {
    Question: 'how are you',
    Answer: 'answer',
  },
  {
    Question: 'hey this is FAQ',
    Answer: 'this is answer',
  },
];

const faqV = (props: FaqVProps) => {
  const output: any = [];
  const getFaq = () => {
    Array.isArray(props?.faqData) && props?.faqData.forEach(items => {
        output.push(

          <div>

    <PanelGroup accordion  >
    <Panel  header={items.Question}>{items.Answer}</Panel>
    </PanelGroup>
    </div>



            // <Panel  header={items.Question}>{items.Answer}</Panel>

        );
      });
    return output;
  };

  return (
    <div>
        {/* <h3 style={{textAlign:"center"}}>{props?.title?.heading}</h3> */}
    {/* <PanelGroup accordion bordered > */}
      {getFaq()}
    {/* </PanelGroup> */}
    </div>
  );
};

export default faqV;
